	echo $cabecalhoSVG;
	
	$result = mysql_query("SELECT * FROM `votosmunicipais` WHERE `estado` = 'RN' AND `deputado` = 'Antônio Jácome';");
	
	while ($row = mysql_fetch_array($result,MYSQL_ASSOC)) {
		$result2 = mysql_query("SELECT codigo FROM `munBrasil` WHERE `municipio` LIKE '".$row['municipio']."';");
		$codMun = mysql_result($result2, 0);
		
		$result3 = mysql_query("SELECT sum( `votos` ) AS `contagem` FROM `votosmunicipais` WHERE `deputado` = '".$row['deputado']."';");
		$totalvotos = mysql_result($result3, 0);
		
		$result4 = mysql_query("SELECT MAX( `votos` ) AS `max` FROM `votosmunicipais` WHERE `deputado` = '".$row['deputado']."';");
		$max = mysql_result($result4, 0);
		
		$result5 = mysql_query("SELECT MIN( `votos` ) AS `min` FROM `votosmunicipais` WHERE `deputado` = '".$row['deputado']."';");
		$min = mysql_result($result5, 0);

		$votos = $row['votos'];
		
		$diff = ((($max/$totalvotos)*100) - (($min/$totalvotos)*100))/5;
		$colorRange=($votos/$totalvotos)*100;
		

		switch (true) {
			case $colorRange == (($max/$totalvotos)*100):
				$color = '#D60039';
				break;

			case $colorRange >= (($max/$totalvotos)*100) - $diff:
				$color = '#DC2657';
				break;
				
			case $colorRange >= (($max/$totalvotos)*100) - ($diff*2):
				$color = '#E34C75';
				break;
				
			case $colorRange >= (($max/$totalvotos)*100) - ($diff*3):
				$color = '#EA7293';
				break;
				
			case $colorRange >= (($max/$totalvotos)*100) - ($diff*3):
				$color = '#F198B1';
				break;
				
			case $colorRange >= (($max/$totalvotos)*100) - ($diff*4):
				$color = '#F8BECF';
				break;
				
			case $colorRange >= 0:
				$color = '#FFE5ED';
				break;
		}
		
